import React from "react";
// import { NavLink,Link } from "react-router-dom";
// import { Nav} from "react-bootstrap";
// import './navbar.css';


export default class Navbar extends React.Component{
    render(){
        return(
        <div id='page-top' >
           <Nav class="navbar navbar-expand-lg navbar-dark fixed-top" id="mainNav">
            <div class="container">
                <a class="navbar-brand bord" href="#page-top"><img src="assets/img/logo_sansfond.png" alt="..." /></a>
                <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
                    Menu
                    <i class="fas fa-bars ms-1"></i>
                </button>
                <div class="collapse navbar-collapse" id="navbarResponsive">
                    <ul class="navbar-nav text-uppercase ms-auto py-4 py-lg-0">
                        <li class="nav-item"><a class="nav-link" href="#page-top">Home</a></li>
                        <li class="nav-item"><a class="nav-link" href="#services">Services</a></li>
                        <li class="nav-item"><a class="nav-link" href="#portfolio">Profils</a></li>
                        <li class="nav-item"><a class="nav-link" href="#about">À propos</a></li>
                        <li class="nav-item"><a class="nav-link" href="#team">Equipes</a></li>
                        <li class="nav-item"><a class="nav-link" href="#contact">Contact</a></li>
                    </ul>
                </div>
            </div>
        </Nav>
             {/* <header class="masthead">
            <div class="container">
                <div class="masthead-subheading">BIENVENUE À GNB</div>
                <a class="btn btn-primary btn-xl text-uppercase" href="#services">En savoir plus</a>
            </div>
        </header> */}
             {/* <Welcome /> */}
        </div> 
            
        )
    }
}
